token = "21eef3b7113149184793c054e9c8382ea5484b2b"
def generate_heatmap(name_stock):
    api_url = "http://maulik-nsemarket-demo.azurewebsites.net/api/stock/heatmap/{}".format(name_stock)
    try:
        response = requests.get(api_url, headers={'Authorization': f"Token {token}"})
        response.raise_for_status()  # Raise an exception for HTTP errors
        data = response.json()

        years = sorted(set([year for month in data.values() for year in month.keys()]), reverse=True)
        months = ['Jan', 'Feb', 'Mar', 'Apr', 'May', 'Jun', 'Jul', 'Aug', 'Sep', 'Oct', 'Nov', 'Dec']

        table_data = np.full((len(years), len(months)), '0%', dtype=object)
        cell_colors = np.full((len(years), len(months)), 'gray', dtype=object)

        for i, year in enumerate(years):
            for j, month in enumerate(months):
                if year in data[month]:
                    value = data[month][year]
                    if isinstance(value, (int, float)):
                        formatted_value = f"{value:.2f}%"
                        table_data[i, j] = formatted_value

                        # Determine color based on value
                        if value > 0:
                            # Scale green from light to dark based on value (adjust intensity here)
                            color_intensity = min(int(value / 1), 255)  # Adjust intensity factor for dark green
                            cell_colors[i, j] = f"rgb(0, {255 - color_intensity}, 0)"
                        elif value < 0:
                            # Scale red from light to dark based on absolute value (adjust intensity here)
                            color_intensity = min(int(abs(value) / 1), 255)  # Adjust intensity factor for dark red
                            cell_colors[i, j] = f"rgb({255 - color_intensity}, 0, 0)"
                        else:
                            cell_colors[i, j] = 'white'  # Zero value shows as white

        fig = go.Figure(data=[go.Table(
            header=dict(values=['Year'] + months),
            cells=dict(values=[years] + [table_data[:, j] for j in range(len(months))],
                       fill_color=[['white'] * len(months)] + [cell_colors[:, j] for j in range(len(months))],
                       font=dict(color='black'),
                       align='center'))
        ])

        fig.update_layout(
            title='Monthly Returns (Jan-Dec)',
            # height=600,
            # width=800,
        )

        return fig

    except requests.exceptions.RequestException as e:
        pass



