def generate_chart(df, chart_type):
    if chart_type == 'Candlestick':
        figure = go.Figure(data=[go.Candlestick(
            x=df['Date'],
            open=df['Open'],
            high=df['High'],
            low=df['Low'],
            close=df['Close']
        )])
    elif chart_type == 'Line':
        figure = go.Figure(data=[go.Scatter(
            x=df['Date'],
            y=df['Close'],
            mode='lines',
            name='Close Price'
        )])
    elif chart_type == 'Bar':
        figure = go.Figure(data=[go.Bar(
            x=df['Date'],
            y=df['Close'],
            name='Close Price'
        )])
    elif chart_type == 'Area':
        figure = px.area(df, x='Date', y='Close', title='Area Chart')
    elif chart_type == 'Scatter':
        figure = px.scatter(df, x='Date', y='Close', title='Scatter Plot')
    elif chart_type == 'Histogram':
        figure = px.histogram(df, x='Close', nbins=50, title='Histogram')
    elif chart_type == 'Box':
        figure = px.box(df, y='Close', title='Box Plot')
    elif chart_type == 'Violin':
        figure = px.violin(df, y='Close', box=True, title='Violin Plot')
    elif chart_type == 'Pie':
        df['month'] = df['Date'].dt.month_name()
        figure = px.pie(df, names='month', values='Close', title='Pie Chart')
    elif chart_type == 'Sunburst':
        df['month'] = df['Date'].dt.month_name()
        figure = px.sunburst(df, path=['month'], values='Close', title='Sunburst Chart')
    elif chart_type == 'Treemap':
        df['month'] = df['Date'].dt.month_name()
        figure = px.treemap(df, path=['month'], values='Close', title='Treemap')
    elif chart_type == 'Funnel':
        figure = px.funnel(df, x='Date', y='Close', title='Funnel Chart')
    elif chart_type == 'Polar':
        figure = px.line_polar(df, r='Close', theta='Date', line_close=True, title='Polar Line Chart')

    figure.update_layout(
        title = 'Historical Data',
        xaxis_title='Date',
        yaxis_title='Price',
        xaxis_rangeslider_visible=False
    )
    return figure